function Vids() {
  return (
    <>
      <div className="vids">
        <div className="thumbnail">
        </div>
        <div className="chnl_text">
          <div className="chnl_pic">
          </div>
          <div className="vid_desc">
            <div className="main_desc">HI welcome to my channel</div>
            <div className="chnl_name">Arnav Gaur</div>
            <div className="vid_stats">
              <div className="vid_views">300k views</div>
              <div className="partition">.</div>
              <div className="vid_date">3 months</div>
            </div>
          </div>
        </div>
      </div>
    </>
  )
}

const arr = [1, 2, 3 ,4, 5, 6, 7, 8, 9];

const Home = () => {
    
    return(
      <>
      <div className="scroll_top">
        <div className="All">
          All
        </div>
      </div>

      <div className="vid_holder">

        {/* <div className="vids">

        </div> */}
        {arr.map(() => <Vids />)}

        
      </div>
      </>
    )

  };
  
  export default Home;
